void	dihedrals2DISICL( float * di, int ** ssout, int num_res ) {
    int *ss, vl1, vl2;

	ss = ( int * ) malloc( sizeof( int ) * num_res + 1 );

	for(int i=0;i<num_res;i++)
	{

		if ((di[i*7+0]!=9999)&&(di[i*7+1]!=9999)) // tag to remove N & Ct
//			ss[i]=rama_map[ int (floor(di[i*7+0]+179.99999))][int (floor(di[i*7+1]+179.99999))];
			{
			vl1=int (ceil(di[i*7+0])+180);
		    vl2=int (ceil(di[i*7+1])+180);
		    if (vl1>=360) vl1=359;
		    if (vl2>=360) vl2=359;
			ss[i]=rama_map[vl1][vl2];
			}
			else ss[i]=0;
// printf ("%d %f %f %d\n",i,di[i*7+0],di[i*7+0],ss[i]);

	}


	for(int i=0;i<num_res-1;i++)
	{

	  ss[i]=seg_def[ss[i]][ss[i+1]];
//	  int simple;
//	  simple=DISICL_d2simple[ss[i]];
//	  printf("%6d %12.6f %12.6f %12.6f %3d %3d %3s %3d %3s\n",i+1, di[i*dh_comps+0], di[i*dh_comps+1], di[i*dh_comps+2],ss[i],
//	  				ss[i],DISICL_d[ss[i]],	simple, DISICL_s[simple]);

	}

	*ssout=ss;
}






